import logo from "./logo.svg";
import "./App.css";
// var celestiump2p = require('celestiump2p');
import * as celestiump2p from 'celestiump2p';
import { testShit } from "celestiump2p";

function App() {
  const PC_CONFIG = {
    iceServers: [
      {
        urls: "stun:stun.l.google.com:19302",
      },
    ],
  };
  celestiump2p.RTCPeerConnection = RTCPeerConnection;
  celestiump2p.RTCSessionDescription = RTCSessionDescription;
  celestiump2p.RTCIceCandidate = RTCIceCandidate;
  console.log(testShit(PC_CONFIG));
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
